import{ signInWithPopup } from 'firebase/auth';
import React from 'react';
import { auth,provider } from './Firebase.js';

function Login() 
{
  function signin()
  {
    signInWithPopup(auth,provider)
    .then()
    .catch()
  }
  return (
    <div>
      <button onClick={signin}>Signin with Google</button>
    </div>
  )
}

export default Login
